canonical_solution:
class Solution:
    def numRabbits(self, answers: List[int]) -> int:
        counter = Counter(answers)
        return sum([math.ceil(v / (k + 1)) * (k + 1) for k, v in counter.items()])

inefficient_solution:
class Solution:
    def numRabbits(self, answers: List[int]) -> int:
        counter = {}
        for answer in answers:
            if answer in counter:
                counter[answer] += 1
            else:
                counter[answer] = 1

        total_rabbits = 0
        for k, v in counter.items():
            required_pairs = (k + 1) * math.ceil(v / (k + 1))
            total_rabbits += required_pairs

        return total_rabbits
